import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'

export default class MaxListingsRow extends React.Component {
	constructor(props) {
		super(props);
	}

	/* ---- Q1b (Dashboard) ---- */
	/* Change the contents (NOT THE STRUCTURE) of the HTML elements to show a movie row. */
	render() {
		return (
			<div className="maxListings">
				<div className="listing">{this.props.listing}</div>
				<div className="avg_price">{this.props.avgprice}</div>
                <div className="max_price">{this.props.max_price}</div>
                <div className="min_price">{this.props.min_price}</div>
			</div>
		);
	}
}
